subroutine TwoDPES(r10, r20, va)
    implicit real(kind = 8)(a-h, o-z)
    parameter (pi = 3.141592653589793d0)
    common /ranges/xmin, ymin, xmax, ymax
    common /bvcutt/vcut, vmin

    r1 = r10
    r2 = r20

    CALL SPl2t(r1, r2, va)

    return
end

subroutine spl2t(r1, r2, v)
    implicit real(kind = 8)(a-h, o-z)
    parameter (nx = 100, ny = 100)
    parameter (m = 100, n = 100, l = 100)
    dimension xt(m)
    dimension y(m), ss(m), sss(m), y2(l)
    data dy1, dyn/1.0d30, 1.0d30/
    common /bvcutt/vcut, vmin
    common /pest/pesmin, ydat(nx, ny), xdat(nx), ve(nx, ny), ind(nx)

    do i = 1, nx
        nh = 0
        do k = 1, ind(i)
            nh = nh + 1
            xt(nh) = ydat(i, k)
            y(nh) = ve(i, k)
        end do
        call spline_d(xt, y, nh, dy1, dyn, y2)
        call splint_d(xt, y, y2, nh, r2, y3)

        ss(i) = y3
    end do
    nt = 0
    do j = 1, nx
        nt = nt + 1
        xt(nt) = xdat(j)
        y(nt) = ss(j)
    end do
    call spline_d(xt, y, nt, dy1, dyn, y2)
    call splint_d(xt, y, y2, nt, r1, yw2)

    v = yw2

    return
end
!##################################################################
!# SPLINE ROUTINES
!#            Numerical recipes in fortran
!#            Cambrige University Press
!#            York, 2nd edition, 1992.
!##################################################################
SUBROUTINE splint_d(xa, ya, y2a, n, x, y)
    implicit double precision  (a-h, o-z)
    DIMENSION xa(n), y2a(n), ya(n)
    klo = 1
    khi = n
    1    if (khi - klo>1) then
        k = (khi + klo) / 2
        if(xa(k)>x)then
            khi = k


        else
            klo = k
        endif
        goto 1
    endif
    h = xa(khi) - xa(klo)
    if (h==0.0d0) write(6, *) 'bad xa input in splint_d'
    a = (xa(khi) - x) / h
    b = (x - xa(klo)) / h
    y = a * ya(klo) + b * ya(khi) + ((a**3 - a) * y2a(klo) + (b**3 - b) * y2a(khi)) * (h**2)/6.0d0
    return
END

!##############################################################################
SUBROUTINE spline_d(x, y, n, yp1, ypn, y2)
    implicit double precision  (a-h, o-z)
    DIMENSION x(n), y(n), y2(n)
    PARAMETER (NMAX = 100)
    DIMENSION u(NMAX)
    if (yp1>.99d30) then
        y2(1) = 0.0d0
        u(1) = 0.0d0
    else
        y2(1) = -0.5d0
        u(1) = (3.0d0 / (x(2) - x(1))) * ((y(2) - y(1)) / (x(2) - x(1)) - yp1)
    endif
    do i = 2, n - 1
        sig = (x(i) - x(i - 1)) / (x(i + 1) - x(i - 1))
        p = sig * y2(i - 1) + 2.0d0
        y2(i) = (sig - 1.0d0) / p
        u(i) = (6.0d0 * ((y(i + 1) - y(i)) / (x(i+1)-x(i))-(y(i)-y(i-1))/(x(i)-x(i-1)))/(x(i+1)-x(i-1))-sig*u(i-1))/p
    end do
    if (ypn>.99d30) then
        qn = 0.0d0
        un = 0.0d0
    else
        qn = 0.5d0
        un = (3.0d0 / (x(n) - x(n - 1))) * (ypn - (y(n) - y(n - 1)) / (x(n) - x(n - 1)))
    endif
    y2(n) = (un - qn * u(n - 1)) / (qn * y2(n - 1) + 1.0d0)
    do k = n - 1, 1, -1
        y2(k) = y2(k) * y2(k + 1) + u(k)
    end do
    return
END
